# -*- coding: utf-8 -*-

class Toilet
  def initialize(lat, long, type, label, address)
    @coordinate = CLLocationCoordinate2D.new
    @coordinate.latitude = lat
    @coordinate.longitude = long
    @type = type
    @label = label
    @address = address
  end

  def coordinate; @coordinate; end
  def label; @label; end
  def type; @type; end
  def address; @address; end
  def title; address.split(',').first; end

  def is_suitable_for_handicap?
    ['WCH','WCH2'].include? type
  end

  def distanceFrom(location)
    pointA = location
    pointB = coordinate
    pointALocation = CLLocation.alloc.initWithLatitude(pointA.latitude, longitude: pointA.longitude)
    pointBLocation = CLLocation.alloc.initWithLatitude(pointB.latitude, longitude: pointB.longitude)

    @distance = pointBLocation.distanceFromLocation(pointALocation)
    "#{@distance.round.to_s}m"
  end

